import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
// import { SwitchRouter } from 'react-router';
import ProductListing from './components/ProductListing'; 
import ProductDetail from './components/ProductDetail';

import image1 from './images/image1.jpg';

function App() {
  const products = [
    {
      id: 1,
      name: 'Luminous GPTTEX 240 AH',
      image: image1,
      price: 49.99,
      capacity:'35AH',
      warranty:'3yrs',description:'Luminous Power Technologies is a powerful and trustworthy brand with a wide range of innovative products in the power backup, and residential solar space.With 7 manufacturing units, more than 28 sales offices in India and presence in over 36 countries, our 6000 employees serve more than 60,000 channel partners and millions of customers. Our motto has always been Customer Delight through Innovation & Passion with the focus on Execution & Team-work. At Luminous, we passionately innovate to make life comfortable and efficient.Luminous Power Technologies is a powerful and trustworthy brand with a wide range of innovative products in the power backup, and residential solar space.With 7 manufacturing units, more than 28 sales offices in India and presence in over 36 countries, our 6000 employees serve more than 60,000 channel partners and millions of customers. Our motto has always been Customer Delight through Innovation & Passion with the focus on Execution & Team-work. At Luminous, we passionately innovate to make life comfortable and efficient.'
     },
     {
      id: 2,
      name: 'Luminous 24v Deep Cycle Battery',
      image: image1,
      price: 69.99
     },
     {
      id: 3,
      name: 'Luminous 60Ah 12v Battery',
      image: image1,
      price: 54.99
     },
     {
      id: 4,
      name: 'Luminous 120Ah 24v Battery',
      image: image1,
      price: 99.99
     },
     {
      id: 5,
      name: 'Luminous 50Ah 12v Battery',
      image: image1,
      price: 42.99
     },
     {
      id: 6,
      name: 'Luminous 100Ah 24v Battery',
      image: image1,
      price: 79.99
     },
   ];

  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<ProductListing products={products} />} />
        <Route path="/product/:id" element={<ProductDetail products={products} />} />
      </Routes>
    </Router>
  );
}

export default App;
